$("#settore").on("change",function(){var n=$("#settore :selected").val();$("#collezione").val("0");$("#collezione").removeAttr("disabled");$.ajax({type:"GET",url:baseUrlCollezioni,data:{codicesettore:n},success:function(n){for(var i="",t=0;t<n.length;t++)i+='<option value="'+n[t].codicecollezione+'">'+n[t].descrizionecollezione+"<\/option>";t==0&&(alert("Il settore non ha collezioni corrispondenti verificare e correggi"),$("#settore").focusin());$("#collezione").html(i)},error:function(n){alert("Error during process: \n"+n.responseText)}})});